import React from 'react';
import { Link } from 'react-router-dom';
import './LandingPage.css'; // Optional: Add custom styles here

function LandingPage() {
    return (
        <div className="landing-container">
            <h1>Welcome to the Mentoring System</h1>
            <p>Please choose an option to log in:</p>
            
            <div className="button-group">
                <Link to="/login" className="btn btn-primary btn-lg">Student Login</Link>
                <Link to="/mentorlogin" className="btn btn-secondary btn-lg">Mentor Login</Link>
            </div>
        </div>
    );
}

export default LandingPage;
